// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;

contract Auction {
    address payable public owner;
    uint public startBlock;
    uint public endBlock;
    string public ipfsHash;

    enum State {Started, Running, Ended, Canceled}
    State public auctionState;

    uint public highestBindingBid;
    address payable public highestBidder;

    mapping(address => uint) public bids;

    uint public bidIncrement;

    constructor(string memory _ipfsHash, uint _bidIncrement, uint _durationBlocks) {
        owner = payable(msg.sender);
        auctionState = State.Running;
        startBlock = block.number;
        endBlock = startBlock + _durationBlocks;
        ipfsHash = _ipfsHash;
        bidIncrement = _bidIncrement;
    }

    modifier notOwner() {
        require(msg.sender != owner, "Owner cannot bid");
        _;
    }

    modifier afterStart() {
        require(block.number >= startBlock, "Auction not started yet");
        _;
    }

    modifier beforeEnd() {
        require(block.number <= endBlock, "Auction already ended");
        _;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    function min(uint a, uint b) pure internal returns (uint) {
        return a <= b ? a : b;
    }

    function cancelAuction() public onlyOwner {
        auctionState = State.Canceled;
    }

    function placeBid() public payable notOwner afterStart beforeEnd {
        require(auctionState == State.Running, "Auction not running");
        require(msg.value >= 100, "Minimum bid is 100 wei");

        uint currentBid = bids[msg.sender] + msg.value;
        require(currentBid >= highestBindingBid + bidIncrement, "Bid increment too low");

        bids[msg.sender] = currentBid;

        if (currentBid <= bids[highestBidder]) {
            highestBindingBid = min(currentBid + bidIncrement, bids[highestBidder]);
        } else {
            highestBindingBid = min(currentBid, bids[highestBidder] + bidIncrement);
            highestBidder = payable(msg.sender);
        }
    }

    function finalizeAuction() public {
        require(auctionState == State.Canceled || block.number > endBlock, "Auction not yet finalized");
        require(msg.sender == owner || bids[msg.sender] > 0, "Not a participant");

        address payable recipient;
        uint value;

        if (auctionState == State.Canceled) {
            recipient = payable(msg.sender);
            value = bids[msg.sender];
        } else {
            if (msg.sender == owner) {
                recipient = owner;
                value = highestBindingBid;
            } else if (msg.sender == highestBidder) {
                recipient = highestBidder;
                value = bids[highestBidder] - highestBindingBid;
            } else {
                recipient = payable(msg.sender);
                value = bids[msg.sender];
            }
        }

        bids[recipient] = 0;
        (bool success, ) = recipient.call{value: value}("");
        require(success, "Transfer failed");
    }
}
